var tipuesearch = {"pages": [{'title': 'Week', 'text': 'Week2~5 \n Week6~9 \n Week10~14 \n Week15~18', 'tags': '', 'url': 'Week.html'}, {'title': 'Week2~5', 'text': '第二周為建立個人倉儲 \n 1.進入老師網站下載2019fall \n 2.進入github建立新倉儲 \n 3.接著把倉儲的網址clone至隨身碟中 \n 4.把老師的倉儲git submodule至cad2019資料夾中的cmsimde \n 5.接著輸入python wsgi.py即可開啟進端來修改網頁 \n 6.修改好後按下save並轉成靜態網站 \n 7.使用git status git add . git commit git push 來將更新完的資料推上github \n 下連結為操作影片: https://youtu.be/zWk2l1IycY8 \n \n 第三周為編譯solvespace \n 1.至老師的首頁並將游標移至TASK接著點選SOLIVESPACE編譯 \n 2.進入solviespace編譯後裡面就有清楚交代每個步驟來進行編譯 \n 3.跟著步驟做完後再將老師給的.dall補釘包下載下來複製貼上到cad2019中來補齊缺失的檔案 \n 下連結為操作影片: https://youtu.be/KsRULmWi-Os \n \n 第五周為操作solvespace \n 基本上就是跟著影片裡的人一起操作 \n 裡面也有解說基本的快捷鍵以及限制條件的方法 \n 下連結為操作影片: https://youtu.be/ZvZRASkGty8 \n', 'tags': '', 'url': 'Week2~5.html'}, {'title': 'Week6~9', 'text': '架設blog \n \n 下連結為建立BLOG的範例影片 https://youtu.be/L9YAYsLsORM \n \n', 'tags': '', 'url': 'Week6~9.html'}, {'title': 'Week10~14', 'text': '第10週:Fork倉儲 \n 1.登入自己的github，並且搜尋自己小組的分組倉儲 \n 2.點選右上角的fork，再點選自己的倉儲 \n 3.輸入指令 git clone --recurse-submodules (小組的倉儲網址) \n 4.等待下載完成即可 \n 下連結為操作影片:https://youtu.be/kULMk6BK79Q \n \n 第11週: 組員個別整理電子書內容 \n 此為NX12參考連結: http://mde.tw/cad2019/downloads/NX-12-for-Engineering-Design.pdf \n 第三章:二維草圖 \n 本章為教學如何在NX12中新建和編輯草圖， 我們可以在建模型的應用功能新建草圖平面， 通常建立模型都是從2D草圖開始的然後再用伸長、旋轉或掃出來建立實體，有複雜的形狀導致難以簡單的拉伸， 後面會有一些範例來示範如何運用草圖來長出工件。 \n 3.1概念 一個nx12的草圖是將曲線編入後掃出，形成一個固體， 我們可以使用應用約束和幾何約束以完全約束草圖，繪製完成後，可以使用多種方法來生成3D零件 \n • 使用旋轉來長出 \n   \n • 使用伸長來長出 \n \n • 使用掃出來長出 \n \n 從草圖創建的特徵和尺寸， 如果草圖更改，特徵也會更改。 以下是使用草圖創建的優點: \n •用於創建輪廓的曲線是非常靈活的，可用於建模\n不尋常的形狀。\n•曲線是參數化的，因此具有關聯性，可以輕鬆更改或刪除它們。\n•如果更改了繪製草圖的平面，則草圖將被更改。\n•當你想要控制特徵的輪廓時，只要進入草圖裡面做更改後， 其特徵皂性也能立即做出更改。 \n 3.2草圖環境 \n 在NX 12中，可以使用兩種方法創建草圖。 第一種方法是在當前環境 \n 以下做示範:➢ 選擇目錄→插入→草圖 \n \n 也可以使用另一種方法 \n ➢在主工具欄中選擇草圖 \n 無論哪種方式來建立，都會彈出一個視窗來詢問\n定義草圖平面。畫面會顯示草圖選項。可以選擇草圖平面， 草圖繪製方向和類型草圖的平面。 使用“創建草圖”視窗創建草圖時，可以選擇\n通過點擊所示的坐標系可以在其上創建草圖的平面。 這個將突出顯示你選擇的平面。 例子: \n ➢選擇XC-YC平面並點擊確定 \n 將顯示草圖平面，並標記X-Y方向。 \n 主畫面將更改為"草繪環境"。 XY平面突出顯示為用於草繪的默認平面。 這是基本的草圖窗口。還有一個特殊的草繪任務用在\nNX 12中的環境，它在主窗口中顯示所有草圖工具。 用於草繪任務的環境。 \n ➢直接點擊草圖工具欄區域中的更多選項 \n ➢在草圖環境中點擊打開，如下圖所示: \n 在Continuous Auto Dimensioning旁邊有三個選項，第一個是改變框中的草圖名稱。 下一個是定義草繪從而將視圖定向到草圖平面。 如果模型文件是在草繪過程中旋轉，請點擊此圖標以查看在平行於屏幕的平面上繪製草圖 重新附著將草圖附加到另一個平面上，基準平面或路徑，或更改草圖方向。 它允許您將草圖重新附加到所需的平面，而無需重新創建所有曲線，尺寸和約束。 \n 3.3草圖曲線工具欄 \n 該工具欄包含用於創建常用類型的圖標曲線、編輯、伸展 、 修剪 \n 、 圓角等。每種類型的曲線都有不同的方法選擇和創建方法。 讓我們討論最多常用選項。 \n \n \xa0 \n 輪廓 \n \n 此選項會根據您在彈出工具欄中選擇的圖標創建直線和圓弧。您可以使用坐標系或輸入長度和\n線的角度如下圖所示。 \n \n \n \n 線 \n 此功能可以在草圖上畫出直線。 \n 弧 \n 此功能可以用兩種方法來建立曲線 第一種:用任意三點來繪製曲線 第二種:圓心起點/終點畫弧先選取曲線的圓心位置，再分別點選曲線的起點和終點來匯出曲線 如下圖所示: \n \n 圓 \n 創建圓類似於創建圓弧，不同之處在於，圓是封閉的。 \n 快速修剪 \n 這將從曲線的交點修剪延伸的曲線。該選項顯示為如果每個實體與另一個實體相交， 則將它們拆分，並刪除 已選擇 該部分。 \n \xa0 \n Studio Spline \n 可以使用點或通過點創建基本樣條曲線。\n所需的曲線度。樣條線將在第七章中詳細討論（自由格式特徵）。 3.4約束工具欄 \n \xa0 \n 所有曲線都是通過拾取點創建的。例如，一條直線有兩個點。\n在2D環境中，任何點都有兩個自由度，一個沿X，另一個沿Y\n軸。點的數量取決於要創建的曲線的類型。因此，曲線實體\n自由度是其自己本身兩倍。 這些程度可以通過創建具有固定實體的約束來消除自由度。 實際上，建議通過刪除以下所有自由度（使草圖完全受約束）\n實體直接或間接地歸屬於固定實體。 可以通過賦予尺寸或幾何特性，如平行度，垂直度等。 \n 在NX 12中，智能約束是自動應用的，即自動尺寸或幾何\n約束由NX 12解釋。您可以通過單擊“連續自動”來關閉此選項。\n尺寸如下圖所示。以下段落顯示瞭如何手動應用約束。 \n \xa0 \n 尺寸約束 \n 通過給尺寸賦予固定實體（例如軸）的尺寸，可以消除自由度，\n平面，坐標系或模型中創建的任何現有實體幾何。 這些尺寸可以是線性，徑向，角度等。 可以隨時編輯尺寸值在草圖繪製過程中，雙擊尺寸。 \n 幾何約束 \n 除了尺寸約束外，還可以給出一些幾何約束來消除自由程度。 它們包括平行，垂直，共線，同心，水平，垂直，等長等。 該軟件具有查找以下可能約束的能力所選實體。 例如，將約束應用到下圖中的行上平行於矩形的左側（該線最初與矩形成一定角度）。 \n \xa0 \n \n 顯示草圖約束 \n \n 單擊此圖標將顯示與該特定草圖中的實體相關的所有選項。\xa0 \n \n 顯示/刪除約束 \n \n 該窗口列出了與所選任何實體相關的所有約束和約束類型。\n可以刪除任何列出的約束或更改約束的順序。\n狀態行中顯示不受約束的自由度。 所有應通過遵循約束模型的方式來應用約束和消除這些約束。 \n \n \n 3.5範例 3.5-1 \n ➢ 繪製以下草圖 \n ➢在Z方向上將該草圖拉伸60 mm \n 3.5-2 ➢按照如下所示應用尺寸約束 \n \n 選擇所有尺寸。 \n 右鍵單擊並隱藏尺寸 \n 選擇菜單→編輯→移動對像或選擇 從功能區欄中移動曲線 \n 選擇所有曲線。您應該看到有四個物體 在選擇對像中選擇 \n 指定運動為距離 \n 在指定向量中選擇YC方向 \n 輸入距離為0.5英寸 \n 在結果對話框中，確保單擊 複製原始單選按鈕 \n 點擊確定 \n 然後使用 基本曲線以完成草圖 \n \n \n \xa0 \n \n 草圖已準備好後: \n \n 選擇編輯→移動對像或從功能區欄中選擇移動曲線 \n 選擇外部曲線。確保選擇曲線的所有四個部分 \n 在Y方向上將下部曲線移動-1.5英寸。 這一樣在YC負方向上1.5英寸 \n \n 這將在套管外部形成曲線。 \n ➢使用直線將此曲線與套管的內部曲線連接如圖所示，它將形成一條閉合鏈曲線。 \n 現在，將在較小的一側創建套管外部所需的曲線，這將形成凸緣部分。 \n \n 選擇編輯→移動對象 \n 選擇外線，如下圖所示 \n \n \n \n 在XC方向上將下部曲線移動-0.5英寸。 這一樣在XC負方向上0.5英寸 \n 使用直線將兩條線連接起來，如右圖所示 \n 單擊完成標誌 \n 保存並關閉文件 \n \n 3.6 練習 \n 3.6.1 圓形底座 \n \n 3.6.2固定器的草圖 \n \n \xa0 \n \xa0 \n \n \xa0 \n \xa0 \n', 'tags': '', 'url': 'Week10~14.html'}, {'title': 'Week15~18', 'text': '\n', 'tags': '', 'url': 'Week15~18.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}]};